glsl3.frag:
precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
  #endif
}
void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
  #endif
}
in vec4 v_color;
#if USE_TEXTURE
in vec2 v_uv0;
uniform sampler2D texture;
#endif
uniform blocku{
  vec2 size;
  float amount;
  float cellSize;
  float rotation;
};
void main () {
  vec4 o = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
  vec4 texture_tmp = texture(texture, v_uv0);
  #if CC_USE_ALPHA_ATLAS_texture
      texture_tmp.a *= texture(texture, v_uv0 + vec2(0, 0.5)).r;
  #endif
  #if INPUT_IS_GAMMA
    o.rgb *= (texture_tmp.rgb * texture_tmp.rgb);
    o.a *= texture_tmp.a;
  #else
    o *= texture_tmp;
  #endif
  #endif
  float ratio=cellSize/size.y;
  float _rad=radians(rotation);
  vec2 centerUV=vec2(v_uv0.x-0.5,0.5-v_uv0.y);
  centerUV.x*=size.x/size.y;
  centerUV=vec2((centerUV.x*cos(_rad)-centerUV.y*sin(_rad)),centerUV.x*sin(_rad)+centerUV.y*cos(_rad));
  float _amount=amount*2.0+1.0;
  float _h=min((1.6429*amount-0.6429)*3.6,120.0);
  float _toRadius=3.14/(2.0*amount*ratio);
  float _result=0.0;
  for(float i=0.0;i<100.0;i+=1.0){
    if(i>=_amount)break;
     float _dis=i-amount;
     float _distance=floor(_dis)*ratio;
     float _disToLineY=abs(centerUV.y-_distance);
     float _disToLineX=abs(centerUV.x-_distance);
     float _cosA=cos(_distance*_toRadius)*_h/size.y;
     if(abs(centerUV.x)<amount*ratio){
      float _isInY=step(_disToLineY,cos(centerUV.x*_toRadius)*_cosA);
      _result+=_isInY;
      if(_result>=1.0)break;
     }
     if(abs(centerUV.y)<amount*ratio){
      float _isInX=step(_disToLineX,cos(centerUV.y*_toRadius)*_cosA);
      _result+=_isInX;
      if(_result>=1.0)break;
     }
  }
  o *= v_color;
  o.a*=_result;
  ALPHA_TEST(o);
  #if USE_BGRA
    gl_FragColor = o.bgra;
  #else
    gl_FragColor = o.rgba;
  #endif
}

